    const [firstName, setfirstName] = useState('')
    const [lastName, setlastName] = useState('')
    const {id} = useParams();
    useEffect(() => {
        SocialService.getSocialById(id).then((response) => {
            setfirstName(response.data.firstName)
        }).catch(error => {
            console.log(error)
        })
    }, [])
  return (
    <div>
        <th> Account Info </th>
        <tb> {firstName} </tb>
    </div>
  )
}

export default HomePage
